import React from "react";

// Photo imports
import Logo from "../Photos/EchoBond_logo.png";

// Navbar item
function Navbar() {
  return (
    <nav className="bg-gradient-to-r from-start via-middle to-end w-full">
      <div className="flex flex-row justify-between">
        <div className="flex flex-row justify-center items-center mx-8 py-3">
          <img src={Logo} alt="Logo" className="w-12 h-12 my-1" />
          <h4 className="ml-2 text-white font-Cyberfont text-xl select-none">
            {" "}
            EchoBond{" "}
          </h4>
        </div>
        <div className="flex flex-row justify-center items-center mr-8">
          <button className="border border-purple-200 rounded-full bg-purple-200 hover:bg-purple-300 text-white px-4 py-1.5 mr-4 select-none">
            {" "}
            Log In{" "}
          </button>
          <button className="border border-purple-200 rounded-full bg-purple-200 hover:bg-purple-300 text-white px-4 py-1.5 mr-4 select-none">
            {" "}
            Sign Up{" "}
          </button>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
